package Test;

public class Pessoa {
    private String nome;
    private int idade;
    private String localidade;

    public Pessoa(String nome, int idade, String localidade) {
        this.nome = nome;
        this.idade = idade;
        this.localidade = localidade;
    }

    @Override
    public String toString() {
        return "Pessoa{" +
                "nome='" + nome + '\'' +
                ", idade=" + idade +
                ", localidade='" + localidade + '\'' +
                '}';
    }
}
